import React from 'react';

import logo from './logo.png';

import './header.css';

function WebHeader() {
  return (
    <header className='header'>
      <div class='header-container'>
        <div class='title'>Home</div>
        <div class='quote'>"In Your Heart You Know He's Right"</div>
      </div>
        <div className='nav-bar'>
        <img src={logo} className="logo" alt="self" />
          <div class='nav-buttons'>
            <button className='nav-button'>Home</button>
            <button className='nav-button'>Projects</button>
            <button className='nav-button'>Experience</button>
            <button className='nav-button'>Education</button>
            <button className='nav-button'>About Me</button>
          </div>
        </div>
    </header>   
  );
}

export default WebHeader;
